import React, { useState } from 'react';
import { Link } from 'react-router-dom';

const menu = [
	{
		id: 1,
		name: 'home'
	},
	{
		id: 2,
		name: 'about',
		children: [
			{
		 		id: 8,
				name: 'about'
			},
			{
		 		id: 9,
				name: '10'
			},
			{
		 		id: 10,
				name: 'other',
				children: [
					{
						id: 11,
 						name: 'link 1'
					},
					{
						id: 12,
 						name: 'link 2'
					},
					{
						id: 13,
 						name: 'link 3'
					}
				]
			}
		]
	},
	{
		id: 3,
		name: 'blog'
	},
	{
		id: 4,
		name: 'contact'
	},
	{
		id: 5,
		name: 'services'
	},
	{
		id: 6,
		name: 'pricing'
	},
	{
		id: 7,
		name: 'portfolio'
	}
];

function Navbar() {
	const [toggle, setToggle] = useState(false);
  const handleToggle = () => setToggle(!toggle);

  const [dropdown, setDropdown] = useState(false);
  const handleDropdown = () => setDropdown(!dropdown);

	return (
		<nav id="navbar" className={!toggle ? "navbar":"navbar navbar-mobile"}>
 			<ul className={!dropdown ? 'dropdown-active' : null}>
			{
	 			menu.map((m) => {
						if(m.children) {
   						return (
								<li key={m.id}>
									<Link onClick={handleDropdown}>
										<span>{`${m.name[0].toUpperCase() + m.name.slice(1)}`}</span>
										<i className={dropdown ? 'bi bi-chevron-down' : 'bi bi-chevron-right'}></i>
									</Link>
									<ul className={dropdown ? 'dropdown-active' : null}>
									{dropdown ? (
										m.children.map((mc) => <li key={mc.id}><Link to="#">{mc.name}</Link></li>)
		 							) : <></>}
									</ul>
								</li>
							)
						}
						return (
							<li key={m.id}>
								<Link to={m.name}>{`${m.name[0].toUpperCase() + m.name.slice(1)}`}</Link>
							</li>
						)


					}
				)
			}
			</ul>
 			<i onClick={handleToggle} className={`bi mobile-nav-toggle ${!toggle ? 'bi-list' : 'bi-x'}`}></i>
		</nav>
	)
}

function Header() {
	return (
  	<header id="header" className="fixed-top d-flex align-items-center">
			<div className="container d-flex align-items-center justify-content-between">
				<div className="logo">
					<h1 className="text-light"><Link to="/">Serenity</Link></h1>
					{/*<Link to="/">
						<img src="../assets/img/logo.png" alt="" className="img-fluid" />
					</Link>*/}
				</div>
				<Navbar />
			</div>
		</header>
	)
}

export default Header;

